/// 
/// &gt; r.table('games').get(1).delete().run(conn, callback)
/// {old_val: {id: 1, player1: 'Bob', player2: 'Alice'}, new_val: null}
/// 
/// &gt; r.tableDrop('games').run(conn, callback);
/// ReqlRuntimeError: Changefeed aborted (table unavailable)
/// </code></example>
